// ==UserScript==
// @name        Newsfeed Filter
// @namespace   Facebook
// @include     https://www.facebook.com/
// @version     1
// @grant       none
// ==/UserScript==

(function(){
    "use strict"

    var checkedClass = "checked-kjfdskfjdsfd";
    var filteredClass = "filtered-lkasjdfdsf";
    var filteredCoverClass = "filtered-cover-jkfdfdkfjdfdd";

    var filters = [
        /BuzzFeed/i,
        ///shared/i,
        ///Sosti Reis/
        /./i,
    ];

    function addCssRule(/* string */ selector, /* string */ rule) {
        if (document.styleSheets) {
            if (!document.styleSheets.length) {
                var head = document.getElementsByTagName('head')[0];
                head.appendChild(bc.createEl('style'));
            }

            var i = document.styleSheets.length-1;
            var ss = document.styleSheets[i];

            var l=0;
            if (ss.cssRules) {
                l = ss.cssRules.length;
            } else if (ss.rules) {
                // IE
                l = ss.rules.length;
            }

            if (ss.insertRule) {
                ss.insertRule(selector + ' {' + rule + '}', l);
            } else if (ss.addRule) {
                // IE
                ss.addRule(selector, rule, l);
            }
        }
    };

    /* 
       addCssRule("." + filteredClass, "opacity: 0.5;");
       addCssRule("." + checkedClass, "");
       */
    addCssRule("." + filteredCoverClass, "height: 100%; width: 100%; background-color: white !important; position: absolute !important; top: 0; z-index: 3; text-align: center; line-height: 140px; font-size: 40px;");

    function applyFilter() {
        var stories = document.querySelectorAll("[id^=hyperfeed_story]:not(." + checkedClass + ")");
        console.log(stories.length);

        for (var i = 0; i < stories.length; i++ ){
            var story = stories[i];
            var content = story.querySelector('.userContentWrapper > div').textContent;
            for (var j = 0; j < filters.length; j++){
                if (filters[j].test(content)){
                    story.classList.add(filteredClass)
                    story.insertAdjacentHTML('beforeend', "<div class='" + filteredCoverClass + "'>" + filters[j].toString() + "</div>");
                    story.querySelector("." + filteredCoverClass).
                        addEventListener('click', function(ev) {
                            ev.target.style.display = "none"; 
                        });
                        break;
                }
            }
            story.classList.add(checkedClass);
        }
    }

    //var bait_on = "https://fbstatic-a.akamaihd.net/rsrc.php/v2/yP/r/ntHIqvR4OcE.png";
    var bait_on = "data:image/png;base64,";
    var bait_off = "data:image/png;base64,";

    var config_tpl = `
    <div style="display: inline-block; 
                padding: 0 9px; 
                vertical-align: top; 
                line-height: 1.34; 
                font-size: 12px;">
        <img style="height: 27px; 
                    margin: 7px 0 9px;" 
            src="${bait_on}" id="fdksjdksadad">
    </div>`;

    document.querySelector('[role="navigation"]:nth-child(2)').insertAdjacentHTML('beforeend', config_tpl);
    var img = document.querySelector("#fdksjdksadad");
    var on = false;
    var funcToogle = () => { 
        on = !on;
        img.src = on ? bait_on : bait_off; 
    };
    img.addEventListener('click', funcToogle);
    funcToogle();

    setInterval(applyFilter, 1000);
}());
